import { StyleSheet } from "react-native";

export default StyleSheet.create({
    container: {
        flex: 1,
        alignItems: "center",
        justifyContent: "center",
        backgroundColor: "#DFDFDF",
      },
      container2: {
        flex: 1,
        alignItems: "center",
        justifyContent: "center",
        backgroundColor: "#A4E3F9",
        width: "90%",
        borderRadius: 15,
        borderWidth: 2,
        borderColor: "#004A85",
        marginTop: "1%",
        marginBottom: "5%",
        shadowColor: "black",
        shadowOffset: {
          width: 0,
          height: 12,
        },
        shadowOpacity: 0.58,
        shadowRadius: 16.0,
        elevation: 24,
      },
      flatList: {
        backgroundColor: "#ffffff",
        borderRadius: 15,
        borderWidth: 2,
        borderColor: "#004A85",
      },
      txt: {
        fontSize: 15,
        padding: 5,
      },
      linha: {
        flexDirection: "row",
        width: "50",
      },
});
